import React from 'react';
import Child from "./Child";

const Parents = () => {
    return (
        <>
            <Child name="1" properties="Child1" parentName="Parent Component" />  
            <Child name="2" properties="Child2" parentName="Parent Component" />
            <Child name="3" properties="Child3" parentName="Parent Component" />
            <Child name="4" properties="Child4" parentName="Parent Component" />
            <Child name="5" properties="Child5" parentName="Parent Component" />
        </>
    );
};

export default Parents;
